import React from 'react';
import PropTypes from 'prop-types';

import styles from './Foobar.module.css';

export const Foobar = (props) => (
    <div className={ styles.foobar } />
);

Foobar.propTypes = {
    appId: PropTypes.string.isRequired,
};
